import { Container, Navbar } from 'react-bootstrap';
import './AppHeader.css';
import {Outlet, Link, Nav} from 'react-router-dom'

function AppHeader() {
    return(
      <>
        <Navbar className="app-header">
          <Container>

          </Container>
          <div>
          <Nav.Link as={Link} to={"/"} className="mainTextHeader">Raidho Slowbar</Nav.Link>
          <Nav.Link href="#" className="textHeader">Product</Nav.Link>
          <a href="#" className="textHeader">Coffee Beans</a>
          <a href="#" className="textHeader">About Us</a>
          </div>
          <div>
          <a as={Link} to={"/login"} className="textHeader">Log-in</a>
          </div>
        </Navbar>
        <Outlet></Outlet>
      </>
    );
}

export default AppHeader;
